import * as actionTypes from '../actions/actionType.js';
import axios from 'axios';

const initialState = {
    cart: {}
};

const cart = (state = initialState, action) => {
    const UpdateState = {...state};

    switch (action.type) {

        case actionTypes.SET_USER_DECK:
            UpdateState.userCards = action.deck;
            return UpdateState;

        case actionTypes.SET_USER_DECK:
            UpdateState.userCards = action.deck;
            return UpdateState;

        default:
            return state;
            break;
    }
};

export default cart;
